import React from "react";
import { View, Text, Image } from "react-native";
import { StyleSheet as WebStyles, css } from "aphrodite";
const DAOlogoheader = () => (
  <Image
    className={css(webStyles.daologoheader)}
    source={require("./assets/img/DAOtutorlogotest3.png")}
  />
);
class TopView extends React.Component {
  render() {
    return (
      <View className={css(webStyles.topInfo)}>
        <DAOlogoheader />
        <Text className={css(webStyles.daotutorstext)}>DAO Tutors</Text>
      </View>
    );
  }
}

const webStyles = WebStyles.create({
  topInfo: {
    height: 100,
    justifyContent: "flex-start",
    backgroundColor: "#764ABC",
    flexDirection: "row",
    alignContent: "center",
  },
  daotutorstext: {
    //position: "absolute",
    paddingLeft: 150,
    fontFamily: "Manrope-ExtraBold",
    fontSize: 40,
    color: "white",
    alignSelf: "center",
  },
  daologoheader: {
    left: 70,
    height: 70,
    width: 70,
    ":hover": {
      backgroundColor: "white",
    },
    alignSelf: "center",
  },
});

export default TopView;
